import "../App.css"
import Button from '@mui/material/Button';
import { BrowserRouter, Route, Link } from "react-router-dom";

export default function Project(props) {
    console.log('porjects', props)

    return(

            <div className="Project"> 
                <h4>{props.name}</h4>
                <img src={props.image}/>
                {props.desc}

                <button style={{
                    "backgroundColor":" #f8f9fa",
                    "border":" 1px solid #3c4043",
                    "borderRadius":" 4px",
                    "color":" #3c4043",
                    "cursor":" pointer",
                    "fontSize":" 14px",
                    "height":" 36px",
                    "lineHeight":" 27px",
                    "padding":" 0 16px",
                    "margin":"10px"
                                    }}onClick={() => {
                window.open(process.env.PUBLIC_URL + props.link, "_blank")}} type="button">
                View Project</button>

            </div> 


    )
}
